import React from "react";
import { Link } from "react-router-dom";
import { useUser } from "./contexts";
import upsLogo from "./UPSShield.png"

export default function Header(){
    const { user } = useUser();

    return (
        <nav className="bg-black text-white p-4 flex justify-between items-center w-full top-0 z-10 inset-x-0">
            <Link to="/">
                <div>
                    <img src={upsLogo} alt="Logo" className="h-8 mr-2" />
                    <span className="font-semibold text-xl tracking-tight">Overgoods</span>
                </div>
            </Link>
        </nav>
    );
}
